import { useParams } from 'react-router-dom'
import 'leaflet/dist/leaflet.css'
import GetMap from '../hooks/getMap';
import { User } from '../interfaces';

function Dashboard(user : User | null) {
  let { id } = useParams();
  const info = {
    id,
    user
  }
  return (
    <div id="dashboard">
      <br/>
        <div id="map">
          <GetMap {...info}/>
        </div>    

    </div>
  )
}

export default Dashboard;
